This podcast is a continuation on our ongoing conversation about developing community and cultures. Brenda's personal story shows us many consequences of hyper-cultural shame in religious spaces and how it affects others. She talks about her interest in building a culture that gives people the information and abilities to express themselves honestly. As we talk about many sexual topics, this discussion isn't recommended for small children.
Brenda Marie Davies, the creator of God is Grey - a youtube channel & podcast advocating for sex-positive, LGBTQ affirming, science believing Christianity.
